import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';

function App() {

  let url1 = {url: "asdf.example.com", urlID: "1sdf4w3"}; 
  let url2 = {url: "gfhgfh.example.com", urlID: "3333"}; 
  let url3 = {url: "htt.example.com", urlID: "4444"};
  let urlItems = [url1, url2, url3];

  let requests = ["request1", "request2", "request3"];
  let requestInfo = ["info 1", "info 2", "info 3"];

  const [activeURL, setActiveURL] = useState("")

  const selectItem = (id) => {
    console.log("selected url!", activeURL);
    // query database to get requests associated with url
    if (activeURL == "1sdf4w3") {
      requests = ["request4", "request5", "request6"];
    } else if (activeURL == "3333") {
      requests = ["request7", "request8", "request9"];
    } else {
      requests = ["request1", "request2", "request3"];
    }

    setActiveURL(id)

  }


  return (
    <div>
      <header>
        <h1>RecycleBin</h1>
      </header>
      <body>
        <div className="row">
          <div className="left"><UrlList urls={urlItems} activeURL={activeURL} selectItem={selectItem} /></div>
          <div className="middle"><RequestList requests={requests} /></div>
          <div className="right"><RequestBody body={requestInfo}/></div>
        </div>
      </body>
    </div>
  );
}

const UrlList = (props) => {
  return (<div>
    <p>List for URLs</p>
    <ul>
      {props.urls.map(function(obj, index) {
        return <UrlItem obj={obj} index={index} selectItem={props.selectItem} activeURL={props.activeURL}/>
      })}
    </ul>
    </div>); // Iterate through array of URL items, display key components of each one 
}

function UrlItem(props) {
  return (<li index={props.index} onClick={() => props.selectItem(props.obj.urlID)}>
    {props.obj.url}
    </li>); // Display each url item
}

function RequestList(props) {
  return (<div>
    <p>List for Requests</p>
    <ul>
      {props.requests.map(function(name, index) {
        return <RequestItem name={name} index={index} />
      })}
    </ul>
    </div>); // Iterate through array of request items, display key components of each one 
}

function RequestItem(props) {
  return (<li index={props.index}>
    {props.name}
    </li>); // Display each request item
}

function RequestBody(props) {
  return (<div>Body of single request</div>); // display body of request 
}

export default App;
